function showStartupRequestMessage(d,b){var a=$("#startup-request-alert-space");var c;if(d){c=$("<div/>",{"class":"alert alert-success"});c.append("<strong>Success! </strong>")}else{c=$("<div/>",{id:"","class":"alert alert-danger"});c.append("<strong>Error: </strong>")}c.append('<a href="#" class="close" data-dismiss="alert">&times;</a>');c.append(b);a.append(c)}function validateStartupRequest(){var b=$.trim($("#send-startup-username").val());var a=$.trim($("#send-startup-password").val());return !(b.length===0||a.length===0)}function sendStartupRequest(){var b=$.trim($("#send-startup-username").val());var a=$.trim($("#send-startup-password").val());$.post({url:"/startup",data:{username:b,password:a},success:function(c){c=JSON.parse(c);if(c.successful){showStartupRequestMessage(true,"The server will startup shortly")}else{showStartupRequestMessage(false,c.message)}},failure:function(){showStartupRequestMessage(false,"There was a server side error. Please let Andre know.")}})}$("#send-startup-button").click(function(){console.log("Request button pressed");if(validateStartupRequest()){sendStartupRequest()}else{showStartupRequestMessage(false,"Username and password are required")}});